BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "User" (
	"user_id"	INTEGER UNIQUE,
	"name"	TEXT,
	"programType"	TEXT,
	PRIMARY KEY("user_id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Events" (
	"Event_ID"	INTEGER UNIQUE,
	"Title"	TEXT,
	"Location"	TEXT,
	"ParticipantType"	TEXT,
	"EventDate"	TEXT,
	"StartTime"	TEXT,
	"EndTime"	TEXT,
	PRIMARY KEY("Event_ID" AUTOINCREMENT)
);
COMMIT;
